  input: "\"TEXT\",F3PA,\"\",\"Notes to Amended July Quarterly Report 4/1/07-6/30/07
    \ Reference FEC letter September 11, 2007  Please find below the Campaigns Policies
    and Procedures as it relates to best effort .  1. The campaigns original solicitation
    includes a clear and conspicuous request for the contributor information and informs
    the contributor of the requirement of federal law for the reporting of such information.
    In addition to other required compliance information, the following best effort
    wording is used on all solicitations.  Federal law requires us to use our best
    efforts to collect and report the name, mailing address, occupation and name of
    employer of individuals whose contributions aggregate in excess of $200 in an
    election cycle.   2. If the information is not provided, regardless of whether
    the contribution was solicited or not, a minimum of one follow-up, stand alone
    effort to obtain the information is made. The effort occurs no later than 30 days
    after the receipt of the contribution and is requested via mail, email, or telephone
    and is documented in writing.  The request clearly asks for the missing information,
    without soliciting a contribution. The contributor is informed of the requirements
    of federal law for the reporting of such information. In written requests, a pre-addressed
    post card or return envelope is provided. Wording used in all information requests
    follows  We apologize for the inconvenience, but the strict regulations of the
    Federal Election Commission require the campaign to request for the record your
    employer and occupation information.  Please provide the requested information
    below and return it in the enclosed pre-stamped envelope.  As an alternative,
    you could fax it to the Campaign at 619-463-2970 or phone the information to the
    Campaign at 619-463-3896.    Employer ____________________  Occupation _________________________
    \ We sincerely appreciate your assistance in helping us comply with the FEC requirements.
    \ As a follow up request, the Campaign regularly sends out additional requests
    for the information. In mid September the Campaign had 182 contributors that had
    not provided the requested information cycle to date. The Committee sent out 182
    letters requesting the information using the above language. In addition 49 of
    the 182 also received an email. The response to the follow up requests, in some
    cases the third or fourth request, was 68. This equates to a response rate of
